import React, { Component } from "react";
import products from "../products";
export default class Products extends Component {
  constructor({ onProductClick }) {
    super();
  }
  render() {
    return (
      <div className="products-page">
        {products.map((product, index) => (
          <div>
            <h3>{product.name}</h3>
            <p>{product.price}</p>
          </div>
        ))}
      </div>
    );
  }
}
